import React from 'react'
import CIcon from '@coreui/icons-react'
import {
  cil3d,
  cilBell,
  cilCalculator,
  cilCalendar,
  cilChartLine,
  cilChartPie,
  cilCursor,
  cilDrop,
  cilNotes,
  cilPen,
  cilPencil,
  cilPeople,
  cilPuzzle,
  cilSpeedometer,
  cilStar,
} from '@coreui/icons'
import { CNavGroup, CNavItem, CNavTitle } from '@coreui/react'

const _nav = [
  {
    component: CNavItem,
    name: 'Youtube',
    to: '/dashboard',
    icon: <CIcon icon={cilSpeedometer} customClassName="nav-icon" />,
  },
  {
    component: CNavGroup,
    name: 'Accounting',
    icon: <CIcon icon={cilCalculator} customClassName="nav-icon" />,
    items: [
      {
        component: CNavItem,
        name: 'Insert',
        to: '/accounting-insert',
      },
      {
        component: CNavItem,
        name: 'Edit',
        to: '/accounting-edit',
      },
      {
        component: CNavItem,
        name: 'Fetch',
        to: '/accounting-fetch',
      },
    ],
  },
  {
    component: CNavGroup,
    name: 'Attendance',
    icon: <CIcon icon={cilCalendar} customClassName="nav-icon" />,
    items: [
      {
        component: CNavGroup,
        name: 'Churchattendance',
        items: [
          {
            name:'Enter attendance',
            component:CNavItem,
            to : '/attendance-church',
            icon: <CIcon icon={cilPen} customClassName="nav-icon" />,
          },
          {
            name:'Previous attendance',
            component:CNavItem,
            to : '/attendance-student',
          },
        ]
      },
      {
        component: CNavItem,
        name: 'Studentattendance',
        to: '/attendance-student',
      },
    ],
  },
  {
    component: CNavGroup,
    name: 'Member',
    icon: <CIcon icon={cilPeople} customClassName="nav-icon" />,
    items: [
      {
        component: CNavItem,
        name: 'Insert',
        to: '/login',
      },
      {
        component: CNavItem,
        name: 'Edit',
        to: '/register',
      },
      {
        component: CNavItem,
        name: 'Fetch',
        to: '/404',
      },
    ],
  },
]

export default _nav
